import React from "react";
import home from "../images/profile.png";
import education from "../images/education.png";
import certificate from "../images/certifications.png";
import project from "../images/projects.png";
import connect from "../images/connect.png";
import "./Header.css";

const Header = () => {
  function displayOnHover() {
    document.querySelector("p").style.display = "block";
  }
  return (
    <>
      <div className="navBar">
        <div className="navImage">
          <img src={home} alt="Home" onMouseOver={displayOnHover} />
          <p>Profile</p>
        </div>
        <div className="navImage">
          <img src={education} alt="Education" onMouseOver={displayOnHover} />
          <p>Education</p>
        </div>
        <div className="navImage">
          <img
            src={certificate}
            alt="Activities & Achievements"
            onMouseOver={displayOnHover}
          />
          <p>Activities & Achievements</p>
        </div>
        <div className="navImage">
          <img src={project} alt="Projects" onMouseOver={displayOnHover} />
          <p>Projects</p>
        </div>
        <div className="navImage">
          <img src={connect} alt="Connect" onMouseOver={displayOnHover} />
          <p>Connect</p>
        </div>
      </div>
    </>
  );
};

export default Header;
